import React, { useState } from 'react';
import './App.css';

import Header from "./components/Header";

import Home from "./pages/Home"


const App = () => {

  const [userAuth, setUserAuth] = useState({
    authed: false
  })

  if (!userAuth.authed)

  return (
    <div>
      <Header authed={userAuth.authed} />
      <Home />
    </div>
  );

  return (
    <div>
      <Header authed={userAuth.authed} />
      <Home />
    </div>
  )
}

export default App;
